import React from "react";

const Searchresult = (props) => {
    const img =`https://images.unsplash.com/photo-1461988320302-91bde64fc8e4?ixid=2yJhcHBfaWQiOjEyMDd9&w=1500&dpr=2400x300/?${props.name}`;
return(
<div>
    <img src={img}  alt="Search" /> 
</div>
);
};

export default Searchresult;
